// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./DataStorage.sol";

contract Pixelflux is DataStorage {
    address public owner;

    struct Layer {
        address payable owner;
        string color;
    }

    struct Cell {
        uint256 baseValue;
        Layer[] layers;
    }

    mapping(uint => mapping(uint => Cell)) public grid;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    modifier onlyLayerOwner(uint x, uint y, uint256 layerIndex) {
        require(grid[x][y].layers[layerIndex].owner == msg.sender, "Not the owner of this layer");
        _;
    }

    function setLayerColor(uint x, uint y, uint256 layerIndex, string memory newColor) public validCoordinates(x, y) onlyLayerOwner(x, y, layerIndex) {
        grid[x][y].layers[layerIndex].color = newColor;
    }

    function initializeCell(uint x, uint y) internal {
        if (grid[x][y].baseValue == 0) {
            grid[x][y].baseValue = initialValues[x][y] * 10**6;
            grid[x][y].layers.push(Layer({
                owner: payable(owner),
                color: ""
            }));
        }
    }

    modifier validCoordinates(uint x, uint y) {
        require(x < gridWidth, "Invalid x coordinate");
        require(y < gridHeight, "Invalid y coordinate");
        _;
    }

    function buyLayer(uint x, uint y, string memory color) public payable validCoordinates(x, y) {
        buyMultipleLayers(x, y, 1, color);
    }
    function buyMultipleLayers(uint x, uint y, uint256 numLayersToAdd, string memory color) public payable validCoordinates(x, y) {
        initializeCell(x, y);

        uint256 baseValueForCell = grid[x][y].baseValue;
        uint256 totalCost = 0;
        for (uint256 i = 0; i < numLayersToAdd; i++) {
            totalCost += baseValueForCell + (grid[x][y].layers.length + i) * baseValueForCell;
        }
        require(msg.value == totalCost, "Incorrect POL sent");

        uint256 currentLayersCount = grid[x][y].layers.length;

        // Optimized transfer
        address[] memory payoutAddresses = new address[](currentLayersCount);
        uint256[] memory payoutAmounts = new uint256[](currentLayersCount);

        for (uint256 i = 0; i < currentLayersCount; i++) {
            address layerOwner = grid[x][y].layers[i].owner;
            bool found = false;
            for (uint256 j = 0; j < i; j++) {
                if (payoutAddresses[j] == layerOwner) {
                    payoutAmounts[j] += baseValueForCell;
                    found = true;
                    break;
                }
            }
            if (!found) {
                payoutAddresses[i] = layerOwner;
                payoutAmounts[i] = baseValueForCell;
            }
        }

        for (uint256 i = 0; i < currentLayersCount; i++) {
            if (payoutAddresses[i] != address(0)) {
                payable(payoutAddresses[i]).transfer(payoutAmounts[i]);
            }
        }

        for (uint256 i = 0; i < numLayersToAdd; i++) {
            grid[x][y].layers.push(Layer({
                owner: payable(msg.sender),
                color: color
            }));
        }
    }



    function getCellState(uint x, uint y) public view validCoordinates(x, y) returns (uint256, string memory, uint256)  {
        Cell memory cell = grid[x][y];
        return (cell.baseValue, cell.layers[cell.layers.length - 1].color, cell.layers.length);
    }
}
